  false,\n\t\"url\": null,\n\t\"notes\": \"This data set combines vegetation datasets
  from three mapping project areas in the Sacramento Valley and riparian areas of
  the San Joaquin Valley to facilitate regional planning, conservation, and enhancement
  of biological resources by state and local agencies, project partners and regional
  stakeholders. This dataset meets the National Vegetation Classfication Standared
  and California Vegetation Classification and Mapping Standards. Vegetation is mapped
  to the Alliance level with a 1-acre minimum mapping unit. Polygons are also attributed
  with total bird's-eye cover of trees, shrubs and herbs. Detailed reports on the
  classification and mapping standards can be downloaded (see summary for links).\",\n\t\"license_title\":
